import React from 'react';
import ReactDOM from 'react-dom/client';
// import App from './App';
import App,{akshay,value1} from './App';

var root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
    <>
    <App/>
    <h1>Hello {akshay()}. This is relate work {value1} peoples.</h1>
    </>
);
